import * as React from "react";
import Box from "@mui/material/Box";
import { Items } from "./Items";
import { Container, Row, Col } from "reactstrap";

export const Home = () => {
  return (
    <div>
      <Container>
        <Row>
          <Col sx={{ size: 50, offset: 50 }}>
            <h1>Hello</h1>
          </Col>
        </Row>
      </Container>
      <Box
        sx={{
          display: "flex",
          alignItems: "flex-start",
          p: 1,
          m: 1,
          bgcolor: "background.paper",
          height: 100,
          borderRadius: 1,
        }}
      >
        <Items />
        <Items />
        <Items />
      </Box>
    </div>
  );
};
